We can apply the CYK algorithm.  First, for each position i we list which non‐terminals produce the single terminal there:

1. t29 → {NT9, NT6}  
2. t16 → {NT6, NT12}  
3. t7  → {NT7}  
4. t15 → {NT12}  
5. t10 → {NT13}  
